        #region ModHeader
        private RangeInt64? _ModHeaderLocation;
        private IMorrowindModHeaderGetter? _ModHeader => _ModHeaderLocation.HasValue ? MorrowindModHeaderBinaryOverlay.MorrowindModHeaderFactory(PluginBinaryOverlay.LockExtractMemory(_stream, _ModHeaderLocation!.Value.Min, _ModHeaderLocation!.Value.Max), _package) : default;
        public IMorrowindModHeaderGetter ModHeader => _ModHeader ?? new MorrowindModHeader();
        #endregion
        #region GameSettings
        private List<RangeInt64>? _GameSettingsLocations;
        private IMorrowindGroupGetter<IGameSettingGetter>? _GameSettings => _GameSettingsLocations != null ? MorrowindGroupBinaryOverlay<IGameSettingGetter>.MorrowindGroupFactory(_stream, _GameSettingsLocations, _package) : default;
        public IMorrowindGroupGetter<IGameSettingGetter> GameSettings => _GameSettings ?? new MorrowindGroup<GameSetting>(this);
